Stacking order refers to the order that windows are "placed" on the screen, from bottom to top. When the positions of two windows overlap each other, the one closer to the top of the stacking order will obscure or overlap the one lower in the stacking order. You can ensure that a window is always at the top of the stacking order (or at least above all others where this attribute isn't set): window.set_wm_attributes( -topmost(true) )?; You can find the current stacking order, listed from lowest to highest: window .wm_stackorder()? .iter() .for_each( |widget| println!( "stackorder: {}", widget.path() )); You can also just check if one window is above or below another: if window.wm_stackorder_isabove( &other ) {}
if window.wm_stackorder_isbelow( &other ) {} You can also raise or lower windows, either to the very top (bottom) of the stacking order, or just above (below) a designated window: window.raise()?;
window.raise_above( &other )?;
window.lower()?;
