All widgets have several configuration options. These control how the widget is displayed or how it behaves. The available options for a widget depend upon the widget class, of course. There is a lot of consistency between different widget classes, so options that do pretty much the same thing tend to be named the same. For example, both a button and a label have a text option to adjust the text that the widget displays, while a scrollbar would not have a text option since it's not needed. Similarly, the button has a command option telling it what to do when pushed, while a label, which holds just static text, does not. Configuration options can be set when the widget is first created by specifying their names and values as optional parameters. Later, you can retrieve the current values of those options, and with a very small number of exceptions, change them at any time. This is all best illustrated with the following interactive dialog. // cargo run --example configuration_options use tk::*;
use tk::cmd::*; fn main() -> TkResult<()> { let tk = make_tk!()?; let root = tk.root(); // create a button, passing two options: let b = root.add_ttk_button( "b" -text("Hello") -command("button_pressed") )?.grid(())?; // check the current value of the text option: assert_eq!( b.cget( text )?.to_string(), "Hello" ); // check the current value of the command option: assert_eq!( b.cget( command )?.to_string(), "button_pressed" ); // change the value of the text option: b.configure( -text("Goodbye") )?; // check the current value of the text option: assert_eq!( b.cget( text )?.to_string(), "Goodbye" ); Ok( main_loop() )
}

