Tk exposes a treasure trove of information about each and every widget that your application can take advantage of. Much of it is available via the winfo facility; see the winfo command reference for full details. This short example traverses the widget hierarchy, using each widget's winfo_children method to identify any child widgets that need to examined. For each widget, we print some basic information, including it's class (button, frame, etc.), it's width and height, and it's position relative to it's parent. // cargo run --example widget_introspection use tk::*;
use tk::cmd::*; fn print_hierarchy<TK:TkInstance>( w: &Widget<TK>, depth: usize ) -> TkResult<()> { println!( "{}{} w={} h={} x={} y={}" , str::repeat( " ", depth ) , w.winfo_class()? , w.winfo_width()? , w.winfo_height()? , w.winfo_x()? , w.winfo_y()? ); for child in w.winfo_children()? { print_hierarchy( &child, depth+1 )?; } Ok(())
} fn main() -> TkResult<()> { let tk = make_tk!()?; tk.root().add_widgets( -pack( -label( -text("all in one") )) -pack( -frame( -pack( -button( "btn" -text("quit") -command("destroy .") )))) )?; print_hierarchy( &tk.root(), 0 )?; Ok(())
} The following are some of the most useful methods: Method Functionality winfo_class a class identifying the type of widget, e.g. TButton for a themed button winfo_children a list of widgets that are the direct children of a widget in the hierarchy winfo_parent parent of the widget in the hierarchy winfo_toplevel the toplevel window containing this widget winfo_width current width of the widget; not accurate until appears onscreen winfo_height current height of the widget; not accurate until appears onscreen winfo_reqwidth the width the widget requests of the geometry manager (more on this shortly) winfo_reqheight the height the widget requests of the geometry manager (more on this shortly) winfo_x the x position of the top-left corner of the widget relative to its parent winfo_y the y position of the top-left corner of the widget relative to its parent winfo_rootx the x position of the top-left corner of the widget relative to the entire screen winfo_rooty the y position of the top-left corner of the widget relative to the entire screen winfo_vieweable whether the widget is displayed or hidden (all its ancestors in the hierarchy must be viewable for it to be viewable)

