What if some lines of text in the widget are very long, longer than the width of the widget? By default, the text wraps around to the next line. This behavior can be changed with the wrap configuration option. It defaults to char, meaning wrap lines at any character. Other options are word to wrap lines only at word breaks (e.g., spaces), and none meaning to not wrap lines at all. In the latter case, some text of longer lines won't be visible unless we attach a horizontal scrollbar to the widget. (Users can also scroll through the text using arrow keys, even if scrollbars aren't present). Both horizontal and vertical scrollbars can be attached to the text widget in the same way as with other widgets, e.g., canvas, listbox. // cargo run --example text_wrapping_and_scrolling use tk::*;
use tk::cmd::*; fn main() -> TkResult<()> { let tk = make_tk!()?; let root = tk.root(); let txt = root.add_text( "t" -width(40) -height(5) -wrap("none") -yscrollcommand(".ys set") -xscrollcommand(".xs set") )? .grid( -column(0) -row(0) -sticky("nwes") )?; let _xs = root .add_ttk_scrollbar( "xs" -orient("horizontal") -command(".t xview") )? .grid( -column(0) -row(1) -sticky("we") )?; let _ys = root .add_ttk_scrollbar( "ys" -orient("vertical") -command(".t yview") )? .grid( -column(1) -row(0) -sticky("ns") )?; txt.insert( text::Index::end(), "Lorem ipsum...\n...\n... " )?; root.grid_columnconfigure( 0, -weight(1) )?; root.grid_rowconfigure( 0, -weight(1) )?; Ok( main_loop() )
} We can also ask the widget to ensure that a certain part of the text is visible. For example, let's say we've added more text to the widget than will fit onscreen (so it will scroll). However, we want to ensure that the top of the text rather than the bottom is visible. We can use the see method. txt.see( Index::line_char(1,0) )?;

