You can choose whether users can select only a single item at a time from the listbox, or if multiple items can simultaneously be selected. This is controlled by the selectmode option: the default is only being able to select a single item (browse), while a selectmode of extended allows users to select multiple items. The names browse and extended, again for backward compatibility reasons, are truly awful. This is made worse by the fact that there are two other modes, single and multiple, which you should not use (they use an old interaction style that is inconsistent with modern user interface and platform conventions). To find out which item or items in the listbox are currently selected, use the curselection method. It returns a list of indices of all items currently selected; this may be an empty list. For lists with a selectmode of browse, it will never be longer than one item. You can also use the selection_includes index method to check if the item with the given index is currently selected. if lbox.selection_includes( 2 ) { /* omitted */ } To programmatically change the selection, you can use the selection_clear( &self, values: impl IntoTkValues<ListboxIndex> ) method to deselect either a single item or any within the range of indices specified. To select an item or all items in a range, use the selection_set( &self, values: impl IntoTkValues<ListboxIndex> ) method. Both of these will not touch the selection of any items outside the range specified. If you change the selection, you should also make sure that the newly selected item is visible (i.e., it is not scrolled out of view). To do this, use the see_index method. lbox.selection_set( idx )?;
lbox.see( idx )?; When a user changes the selection, a event::virtual_event( "ListboxSelect" ) is generated. You can bind to this to take any action you need. Depending on your application, you may also want to bind to a double-click event::double().button_press_1() event and use it to invoke an action with the currently selected item. lbox.bind( event::virtual_event( "ListboxSelect" ), tclosure!( tk, || -> TkResult<()> { Ok( update_details( lbox.curselection()? )) }
))?; lbox.bind( event::double().button_press_1(), tclosure!( tk, || -> TkResult<()> { Ok( invoke_action( lbox.curselection()? )) }
))?;

